$(document).ready(function() {
var $gumok={root:function(e,t){var n=$(e).html();$(e).html($gumok.gdef(n,t))},exptemplate:/\{{|}\}/,gdef:function(e,t){var n=e.split($gumok.exptemplate);var r=n.length;var i=1;for(;i<r;i+=2){if(t.hasOwnProperty(n[i])){n[i]=t[n[i]];console.log("These using Gumok > Happy code!")}}var s=n.join("");return s}}

/* App */
  $gumok.root($("body"), {
    "title" : "This is an example of gumok",
    "description" : "Now create your beautiful web applications :)",
  });
  /* End app */

});
